export const state = () => (baseState)

export const mutations = {
  setName (state, value) {
    state.name = value
  },
  setSurname (state, value) {
    state.surname = value
  },
  setImage (state, value) {
    state.image = value
  },
  setLocation (state, value) {
    state.location = value
  },
  _addToCart (state, value) {
    state.cart.push(value)
  },
  removeFromCart (state, name) {
    state.cart.splice(state.cart.indexOf(state.cart.find(({ name }) => name)), 1)
  }
}

export const actions = {
  addToCart({ commit, dispatch }, { name, price, callback }) {
    commit('_addToCart', { name, price })
    dispatch('snackbar/set', {
      content: `${name} ajouté`,
      actions: {
        'Voir le panier': callback,
      },
      timeout: 3000
    }, {
      root: true
    })
  }
}

